import NavBar from "./navbar"
import PipeStatusBox from "../components/pipeStatusBox"

function mainPage() {
    return (
        <div>
            <NavBar />
            <div class="bg-white rounded max-w-screen-sm mx-auto">
            <h1 className="text-3xl font-bold">
                Hello world!
            </h1>
            <PipeStatusBox />
            <PipeStatusBox />
            <PipeStatusBox />
        </div>
        </div>
        
        
        );
}

export default mainPage;
